import React from 'react';
import './App.css';
import MovieList from './MovieList';
import Nav from './Nav';

// Curly braces because we are not exporting it as default 
import {MovieProvider} from './MovieContext';

function App() {
  return (
    <MovieProvider>
    <div className="App">
      <Nav />
    <MovieList />
    </div>
    </MovieProvider>
  );
}

export default App;
